import { Card } from 'antd';
import card1 from "./images/card1.png"
import "./subs.css"
const { Meta } = Card;
const Cards = () => (
  <>
  <h1>Bronze Pack</h1>
  <Card
    hoverable
    style={{
      width: 280,
      backgroundColor:'black'
      
    }}
    cover={<img alt="example" className='cards' src={card1} />}
  >
    <button>Subscribe to know more</button>
  </Card>
  </>
);
export default Cards;
